import React from "react";

const Nav = () => {
  return (
    <nav style={styles.container}>
      <ul style={styles.ul}>
        <li style={styles.li}>
          <a style={styles.a} href="News Feed">
            Shop
          </a>
        </li>
        <li style={styles.li}>
          <a href="Messages">Shop</a>
        </li>
        <li style={styles.li}>
          <a href="Watch">Shop</a>
        </li>
      </ul>
    </nav>
  );
};

export default Nav;

const styles = {
  container: {
    position: "fixed",
    width: "10rem",
    backgroundColor: "#0a2463",
    top: "4rem",
    left: "0",
    bottom: "0",
  },
  ul: {
    listStyle: "none",
    padding: "0",
    margin: "2rem",
  },
  li: {
    marginBottom: "1rem",
    color: "#ffffff",
    textDecoration: "none",
  },
};
